import React   from 'react';
import io      from 'socket.io-client'
import annyang from 'annyang'

import logo    from './logo.svg';

import './App.css';

function setupAnnyang() {
  const socket = io();

  const commands = {
    'hello' : () => {
      console.log('Hey Man');
    },
    'open :file :fileExt' : (file, fileExt) => {
      console.log('*****************************')
      console.log(file)
      console.log('*****************************')

      socket.emit('message', {
        operation : 'open',
        file : `${file}${fileExt}`
      })
    }
  }

  annyang.addCommands(commands)
  annyang.start()
}

function App() {
  setupAnnyang()

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
